class Circle:
    def __init__(self, x, y, vx, vy, r):
        self.x = x
        self.y = y
        self.vx = vx
        self.vy = vy
        self.r = r

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y and self.vx == other.vx and self.vy == other.vy and self.r == other.r

    def __hash__(self):
        return hash((self.x, self.y, self.vx, self.vy, self.r))

    def __repr__(self):
        return 'Circle(x={0}, y={1}, vx={2}, vy={3}, r={4})'.format(self.x, self.y, self.vx, self.vy, self.r)

    def __sub__(self, other):
        return Circle(self.x - other.x, self.y - other.y, self.vx - other.vx, self.vy - other.vy, self.r - other.r)

    def __add__(self, other):
        return Circle(self.x + other.x, self.y + other.y, self.vx + other.vx, self.vy + other.vy, self.r + other.r)

    def __mul__(self, k):
        return Circle(self.x * k, self.y * k, self.vx * k, self.vy * k, self.r * k)

    def __rmul__(self, k):
        return Circle(self.x * k, self.y * k, self.vx * k, self.vy * k, self.r * k)

    def __truediv__(self, k):
        return Circle(self.x / k, self.y / k, self.vx / k, self.vy / k, self.r / k)

    def __floordiv__(self, k):
        return Circle(self.x // k, self.y // k, self.vx // k, self.vy // k, self.r // k)

    def __iadd__(self, other):
        self.x += other.x
        self.y += other.y
        self.vx += other.vx
        self.vy += other.vy
        self.r += other.r
        return self

    def __isub__(self, other):
        self.x -= other.x
        self.y -= other.y
        self.vx -= other.vx
        self.vy -= other.vy
        self.r -= other.r
        return self

    def __imul__(self, k):
        self.x *= k
        self.y *= k
        self.vx *= k
        self.vy *= k
        self.r *= k
        return self

    def __itruediv__(self, k):
        self.x /= k
        self.y /= k
        self.vx /= k
        self.vy /= k
        self.r /= k
        return self

    def __ifloordiv__(self, k):
        self.x //= k
        self.y //= k
        self.vx //= k
        self.vy //= k
        self.r //= k
        return self

    def distance(self, other):
        return math.sqrt((self.x - other.x) ** 2 + (self.y - other.y) ** 2)

    def distance_squared(self, other):
        return (self.x - other.x) ** 2 + (self.y - other.y) ** 2

    def area(self):
        return math.pi * self.r ** 2

    def area_weighted_average(self, other):
        return Circle((self.x * self.area() + other.x * other.area()) / (self.area() + other.area()),
            (self.y * self.area() + other.y * other.area()) / (self.area() + other.area()),
