def find_min_moves(cards):
    sorted_cards = sorted(cards)
    min_moves = len(cards)
    for i in range(len(cards)):
        moves = 0
        last_rank = None
        last_suit = None
        for j in range(len(cards)):
            if cards[(i + j) % len(cards)][0] != last_rank:
                moves = moves + 1
            if cards[(i + j) % len(cards)][1] != last_suit:
                moves = moves + 1
            last_rank = cards[(i + j) % len(cards)][0]
            last_suit = cards[(i + j) % len(cards)][1]
        if moves < min_moves:
            min_moves = moves
    return min_moves


