def main():
    N, M = list(map(int, input().split()))
    G = defaultdict(set)
    for _ in range(M):
        a, b = list(map(int, input().split()))
        G[a].add(b)
        G[b].add(a)
    visited = [False] * (N + 1)
    ans = 0
    for i in range(1, N + 1):
        if not visited[i]:
            stack = [i]
            visited[i] = True
            while stack:
                v = stack.pop()
                for nv in G[v]:
                    if not visited[nv]:
                        stack.append(nv)
                        visited[nv] = True
            ans += 1
    print(ans)


