def binom(n, k):
    if k < 0 or k > n:
        return 0
    if k == 0 or k == n:
        return 1
    k = min(k, n - k)
    numer = 1
    denom = 1
    for i in range(k):
        numer = numer * (n - i)
        denom = denom * (i + 1)
    return numer // denom


