MOD = 10 ** 9 + 9


def power(a, b):
    if b == 0:
        return 1
    if b == 1:
        return a
    if b % 2 == 0:
        return power((a * a) % MOD, b // 2)
    else:
        return (a * power((a * a) % MOD, b // 2)) % MOD


def inv(a):
    return power(a, MOD - 2)


