from itertools import combinations
from math import gcd
from functools import reduce
from operator import mul


def lcm(a, b):
    return a * b // gcd(a, b)


def lcm_list(lst):
    return reduce(lcm, lst)


def gcd_list(lst):
    return reduce(gcd, lst)


def solve(cards, k):
    cards.sort(key=lambda x: x[2], reverse=True)
    cards = [x[:2] for x in cards]
    if k == 1:
        return sum(x[0] * x[1] for x in cards)
    cards = [tuple(map(int, x)) for x in cards]
    cards = [list(x) for x in combinations(cards, k)]
    cards = [(lcm_list(x[0]), lcm_list(x[1]), sum(x[2])) for x in cards]
    cards.sort(key=lambda x: x[2])
    return cards[0][2]


