from math import sqrt


def is_squarefree(n):
    for i in range(2, int(sqrt(n)) + 1):
        if n % (i * i) == 0:
            return False
    return True


def solve(n):
    for m in range(2, n):
        if is_squarefree(m * n):
            return m
    return -1


