def evalDPG(s):
    n = len(s)
    dp = [[0] * (n + 1) for _ in range(n + 1)]
    for i in range(n):
        dp[i][i + 1] = int(s[i])
    for l in range(3, n + 1):
        for i in range(n - l + 1):
            j = i + l - 1
            dp[i][j] = dp[i + 1][j] + dp[i][j - 1]
            if s[i] != '0':
                for k in range(i + 1, j):
                    if s[k] == '+':
                        dp[i][j] += dp[i][k - 1] * dp[k + 1][j]
    return dp[0][n - 1]


